                                    )
                                })}
                            </div>
                        </div>
                    </div>
                     </div>
                </section>
        <section id="video" class="py-5" style={{ backgroundImage: `url(${require("./images/seo.png")})` }}>
        <div class="container">
            <div class="row justify-content-center video-icon">
               {Video_Data.map((val)=>{
                   return(
                    <a class="video-popup" href={val.video}>
                    <i class="fab fa-youtube"></i>
                </a>
                   )
               })}
               

            </div>
        </div>
    </section>
